import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({ contacts }) => {

  const tilesListToRender = contacts.map((obj) => (
    <Tile name={obj.name} description={{
      name: "Aaron",
      date: "monday",
      time: "11:30"
    }} />
  ));

  return (
    <div>
      {tilesListToRender}
    </div>
  );
};

